import React from "react";

const Footer = () => {
  return (
    <div className="footer">
      <p className="quantity_items">
        <b>
          <span>4&nbsp;</span>
        </b>
        items&nbsp;left
      </p>
      <div className="filters">
        <p>1</p>
        <p>2</p>
        <p>3</p>
      </div>
      <p className="completed">Completed items</p>
    </div>
  );
};

export default Footer;
